package college.dorm.mappertest;import java.util.Date;import java.util.List;import org.junit.Test;import org.junit.runner.RunWith;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.boot.test.context.SpringBootTest;import org.springframework.test.context.junit4.SpringRunner;import college.dorm.databean.Houseparent;import college.dorm.databean.Student;import college.dorm.mapper.HouseparentMapper;import college.dorm.mapper.StudentMapper;@RunWith(SpringRunner.class)@SpringBootTestpublic class StudentMapperTest {	@Autowired	private StudentMapper sm;	@Test	public void testInsertInto() {		Integer i = sm.insertIntoStudent(111222333, "jeus", 10, 603,				new Date());		System.out.println(i);	}	@Test	public void testSeleAll() {		List<Student> students = sm.selectAllStudents();		for (Student student : students) {			System.out.println(student.toString());		}	}	@Test	public void testDeleById() {		Integer i = sm.deleteBySid(3);		System.out.println(i);	}	@Test	public void testSeleById() {		System.err.println(sm.selectStudentBySid(4));	}	@Test	public void testUpdateById() {		Integer i = sm.updateStudentBySid("qpqp", 6, 450, 4);		System.out.println(i);	}}